import React, { useState } from 'react';
import axios from 'axios';

function UploadForm() {
    const [title, setTitle] = useState("");
    const [description, setDescription] = useState("");
    const [category, setCategory] = useState("");
    const [tags, setTags] = useState("");
    const [author, setAuthor] = useState("");
    const [date, setDate] = useState("");
    const [resourceType, setResourceType] = useState("");
    const [language, setLanguage] = useState("");
    const [copyrightInfo, setCopyrightInfo] = useState("");
    const [file, setFile] = useState(null);
    const [coverPhoto, setCoverPhoto] = useState(null);

    const handleFileChange = (e) => {
        setFile(e.target.files[0]);
    };

    const handleCoverChange = (e) => {
        setCoverPhoto(e.target.files[0]);
    };

    const handleSubmit = (e) => {
        e.preventDefault();
    
        const formData = new FormData();
        formData.append("title", title);
        formData.append("description", description);
        formData.append("category", category);
        formData.append("tags", tags);
        formData.append("author", author);
        formData.append("date", date);
        formData.append("resourceType", resourceType);
        formData.append("language", language);
        formData.append("copyrightInfo", copyrightInfo);
        formData.append("file", file);
        formData.append("coverPhoto", coverPhoto);
    
        // Send the form data to the backend
        axios.post('http://localhost:8080/api/upload', formData)
            .then(response => {
                console.log('File uploaded successfully', response.data);
                alert('File uploaded successfully');
            })
            .catch(error => {
                console.error('Error uploading file', error);
                alert('Error uploading file');
            });
    };
    

    return (
        <div className="upload-form">
            <h2>Upload Educational Resource</h2>
            <form onSubmit={handleSubmit}>
                <input type="text" placeholder="Title" value={title} onChange={(e) => setTitle(e.target.value)} required />
                <textarea placeholder="Description" value={description} onChange={(e) => setDescription(e.target.value)} required></textarea>
                <select value={category} onChange={(e) => setCategory(e.target.value)} required>
                    <option value="">Select Category</option>
                    <option value="Textbook">Textbook</option>
                    <option value="Research Paper">Research Paper</option>
                    <option value="Study Guide">Study Guide</option>
                    <option value="Lecture Notes">Lecture Notes</option>
                    <option value="Presentation">Presentation</option>
                    <option value="Multimedia">Multimedia</option>
                    <option value="Spreadsheets">Spreadsheets</option>
                </select>
                <input type="text" placeholder="Tags (comma separated)" value={tags} onChange={(e) => setTags(e.target.value)} />
                <input type="text" placeholder="Author/Publisher" value={author} onChange={(e) => setAuthor(e.target.value)} required />
                <input type="date" value={date} onChange={(e) => setDate(e.target.value)} required />
                <input type="text" placeholder="Resource Type" value={resourceType} onChange={(e) => setResourceType(e.target.value)} required />
                <input type="text" placeholder="Language" value={language} onChange={(e) => setLanguage(e.target.value)} />
                <input type="text" placeholder="Copyright Info" value={copyrightInfo} onChange={(e) => setCopyrightInfo(e.target.value)} />
                <input type="file" onChange={handleFileChange} required />
                <input type="file" onChange={handleCoverChange} required />
                <button type="submit">Upload Resource</button>
            </form>
        </div>
    );
}

export default UploadForm;
